import React from 'react';
import UserList from '../components/UsersList';

const Users = () => {
    const USERS = [{ id: "u1", name: "kel", image: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fasianwiki.com%2FAi_Shinozaki&psig=AOvVaw2Vccsfn67N_3A_iJ7B9A4V&ust=1626404008445000&source=images&cd=vfe&ved=0CAoQjRxqFwoTCOjipaCJ5PECFQAAAAAdAAAAABAD", places: 3 }];
    return <UserList items={USERS}/>;
};

export default Users;
